import { Route, Routes } from 'react-router-dom';
import './App.css';


function App() {
  return (
   <>
   <button>Login</button>
   <button>Registration</button>

  <Routes>
  <Route  path="/login"></Route>
  <Route path="/registration"></Route>
  </Routes>

   </>
  );
}

export default App;
